import axios from 'axios';
import { resolve } from './resolve.js';

class api{
    constructor(){
      this.base = "https://hi-exchange.com"
    }

    async getOtpToken(mobile) {
      return await resolve(axios.post(this.base + '/api/v2/token/otp/', { mobile }).then(res => res));
    }
    
    async getUser(id) {
      return await resolve(axios.get(`http://some-api.com/users/${id}`).then(res => res.data));
    }
}
export default api
